import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import './styles/all.min.css';
import './styles/animate.css';
import './styles/animated-text.css';
import './styles/bootstrap.min.css';
import './styles/elements.css';
import './styles/em-breadcrumb.css';
import './styles/font-awesome.min.css';
import './styles/meanmenu.min.css';
import './styles/nivo-slider.css';
import './styles/owl.carousel.css';
import './styles/owl.transitions.css';
import './styles/responsive.css';
import './styles/slick.css';
import './styles/style.css';
import './styles/theme-default.css';
import './styles/themify-icons.css';
import './styles/unittest.css';
import './styles/widget.css';
import './scripts/vendor/modernizr-3.5.0.min.js';


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
